import React from "react";
import {cities} from "../constants";
import styles from "./NavBar.module.css"

function NavBar(){
    const size = cities.length;

    return (
        <div className={styles["city-container"]}>
         <button>{"<<"}</button>
         {cities.map((_,index)=>(
            <idv>
                <button>{cities[index]}</button>
            </idv>
         ))}
         <button>{cities[index]}</button>
         <button>{">>"}</button>
        </div>
    );

}
export default NavBar;
